import React from "react";

const EventCard = (props) => {
  return (
    <div className="d-flex flex-column justify-content-center">
      <div className="bg-primary event-card mr-5">
        <img src={props.data.pic} className="full-wid-hei border-rounded" />
      </div>
      <div className="bg-info p-3 event-year center">{props.data.year}</div>
    </div>
  );
};

export default EventCard;
